INSERT INTO `field_data_body` VALUES ('node','article',0,5,5,'und',0,'We create portfolio website for individual with very minimal cost and affordable by any user. With Social Plugin individual can stay connect with their own friends and fans.\r\n\r\nWe also create enterprise portal with Drupal CMS for any big customers with minimal cost.','','filtered_html'),('node','article',0,6,6,'und',0,'Yes. We are providing website with very low price which is affordable by any people who wants to increase their business online.','','filtered_html'),('node','article',0,7,7,'und',0,'We offer our customer to make own website in very low cost. Only TMW Groups provides low price cost website compare to other companies.','','filtered_html'),('node','article',0,9,9,'und',0,'We create website for our customers by providing very low price which is easily affordable by any individual. We make Website making is now cheaper than chocolate. Confused! Contact us today. \r\n\r\nWe help our customer, how to spread your identity, products all over world not only within the country. We have integrated Social plugins for facebook, twiter and more to stay connect with your friends from your own website. \r\n\r\nYou can see facebook post, comments, video everything from your website.','','filtered_html'),('node','article',0,10,10,'und',0,'We believe that we should start to create website for any self starter or any member who really wants to make own website with very cost which they can effort easily.\r\n\r\nWe understand this pain and provide website which is very low cost and anyone can effort this low price. \r\n\r\nOur starting price only $2\r\n\r\nWebsite banao business barao.','','filtered_html'),('node','article',0,11,11,'und',0,'Creating website from us is very easy with us. You can start your website by $2/Monthly only no renewal cost and no hosting cost. Its only for you.','','filtered_html');
