 using HTML5 and CSS3 to easily access website from different device.\r\n										<br><br>\r\n									</li>\r\n									<li>\r\n										We have excellent support for our all Customers. We have own ticketing system where from customers ask for support.\r\n									</li>\r\n								</ol>\r\n							</div>\r\n							<br>\r\n          </td>\r\n        </tr>\r\n        <tr>\r\n          <td class=\"container-padding footer-text\" align=\"left\" style=\"font-family:Helvetica, Arial, sans-serif;font-size:12px;line-height:16px;color:#aaaaaa;\">\r\n            <br>\r\n            &copy; All rights reserved by TMW Groups\r\n            <br>\r\n            You are receiving this email because you opted in on our website. <a href=\"[newsletter:unsubscribe_url]\" style=\"color:#aaaaaa\">Unsubscribe</a>\r\n						<br><br>\r\n          </td>\r\n        </tr>\r\n      </table>\r\n<!--/600px container -->\r\n    </td>\r\n  </tr>\r\n</table>\r\n<!--/100% background wrapper-->\r\n</body>\r\n</html>','','full_html');
